INSERT INTO `appointment_format` (`id`, `name`, `format`, `format_2`) VALUES
(1, 'General', '<h3 style="text-align:center"><u><strong><em>Appointment Letter</em></strong></u></h3>\n\n<p><em>Date - {{today_date}}</em><br />\n<em>Name: {{candidate_name}},</em><br />\n<em>Designation: {{designation}}</em><br />\n<em>Employee Code: {{emp_code}}</em><br />\n<em>Address: {{address}}</em><br />\n<em>Location of Deployment: {{posting_location}}.</em><br />\n<em>Date of Joining: {{doj}}</em><br />\n<em>Tenure of Appointment: {{from}} to {{to}}</em><br />\n<em>Project Name: {{project_name}}</em><br />\n<br />\n<em>With reference to your application and subsequent discussion, it gives us immense pleasure to offer you an appointment in <strong>SBC Exports Ltd.</strong></em><br />\n<em>This is in reference to your employment engagement for some of our eGovernance projects in Jharkhand State.</em><br />\n<em>Details of Terms and Conditions:</em></p>\n\n<ol>\n	<li><em>We are pleased to inform you that you have been selected for the post of </em><strong><em>{{designation}}</em></strong><em> &nbsp;</em><em>for one of our esteemed clients.</em></li>\n	<li><em>You are requested to join on <strong>{{doj}}</strong> and the offer stands withdrawn thereafter, unless the date is extended and communicated to you in writing</em><em>.</em></li>\n	<li><em>Please sign in the duplicate copy of this letter (Photo copy enclosed) on all the sheets at the bottom on the left corner, and return to the Human resource Department of our Corporate Office at Delhi. </em></li>\n</ol>\n\n<p><em>We welcome you to SBC Exports Ltd and look forward to a long term association.</em><br />\n<strong><em>Salary Structure</em></strong></p>\n\n<table align="center" border="1" cellpadding="0" cellspacing="0" style="width:100%">\n	<tbody>\n		<tr>\n			<td style="width:100%">\n			<p><strong><em>Annual Cost to Company&nbsp; {{sal_ctc}}*12 = {{ctc_pa}} Lakh</em></strong></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<table align="center" border="1" cellpadding="0" cellspacing="0" style="width:100%">\n	<tbody>\n		<tr>\n			<td style="width:25%"><strong><em>Earning Components</em></strong></td>\n			<td style="width:25%"><strong><em>Amount</em></strong></td>\n			<td style="width:25%"><strong><em>Deductions</em></strong></td>\n			<td style="width:25%"><strong><em>Amount</em></strong></td>\n		</tr>\n		<tr>\n			<td style="width:25%"><em>Basic</em></td>\n			<td style="width:25%"><em>{{basic}}</em></td>\n			<td style="width:25%"><em>PF(Employee)</em></td>\n			<td style="width:25%"><em>{{sal_pf_emmployee}}</em></td>\n		</tr>\n		<tr>\n			<td style="width:25%"><em>HRA</em></td>\n			<td style="width:25%"><em>{{hra}}</em></td>\n			<td style="width:25%"><em>ESI(Employee)</em></td>\n			<td style="width:25%"><em>{{sal_esi_employee}}</em></td>\n		</tr>\n		<tr>\n			<td style="width:25%"><em>Conveyance</em></td>\n			<td style="width:25%"><em>{{conveyance}}</em></td>\n			<td style="width:25%">&nbsp;</td>\n			<td style="width:25%">&nbsp;</td>\n		</tr>\n		<tr>\n			<td style="width:25%"><em>Telephone Allowance</em></td>\n			<td style="width:25%"><em>{{sal_telephone}}</em></td>\n			<td style="width:25%">&nbsp;</td>\n			<td style="width:25%">&nbsp;</td>\n		</tr>\n		<tr>\n			<td style="width:25%"><em>Special Allowance</em></td>\n			<td style="width:25%"><em>{{sal_management_allowense}}</em></td>\n			<td style="width:25%">&nbsp;</td>\n			<td style="width:25%">&nbsp;</td>\n		</tr>\n		<tr>\n			<td style="width:25%"><em>Total Earning</em></td>\n			<td style="width:25%"><em>{{sal_gross}}</em></td>\n			<td style="width:25%"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Deduction</em></td>\n			<td style="width:25%"><em>{{deduction}}</em></td>\n		</tr>\n		<tr>\n			<td style="width:25%"><em>Net Pay</em></td>\n			<td colspan="3" style="width:75%"><em>Rs.{{sal_net}}</em></td>\n		</tr>\n		<tr>\n			<td style="width:25%"><em>In words</em></td>\n			<td colspan="3" style="width:75%"><em>{{word}}</em></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<table border="1" cellpadding="0" cellspacing="0" style="width:100%">\n	<tbody>\n		<tr>\n			<td style="width:50%"><em>Employer&rsquo;s Contribution to PF</em></td>\n			<td style="width:50%"><em>{{sal_pf_employer}}</em></td>\n		</tr>\n		<tr>\n			<td style="width:50%"><em>Employer&rsquo;s Contribution to ESI</em></td>\n			<td style="width:50%"><em>{{sal_esi_employer}}</em></td>\n		</tr>\n		<tr>\n			<td style="width:50%"><em>Other Benefits Bonus</em></td>\n			<td style="width:50%"><em>{{sal_bonus}}</em></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><em>For <strong>SBC Exports Ltd</strong></em><br />\n<em>Deo Kumar</em><br />\n<em>Sr. Manager &ndash; </em><em>HR &amp; Talent Acquisition</em></p>\n', '<h2 style="text-align:center"><u><strong>Annexure &ndash; A</strong></u></h2>\n\n<p style="text-align:justify"><strong><em>General Terms and Conditions of Employment.</em></strong></p>\n\n<ol>\n	<li style="text-align:justify"><em>You are initially appointed to work at Client location. However, you are liable to be transferred to any department or establishment forming part of the Company, or any Group Company, anywhere in India, temporarily or permanently. Working Days / Hours may vary based on the client requirements. And will be informed by the client</em></li>\n	<li style="text-align:justify"><em>If you undergo training abroad and / or in India for which the company incurs considerable efforts / cost for any project specific requirement etc. you might be required to sign an agreement as a token of commitment, the terms of which will be decided by the company depending on the training period, location, travelling cost, lodging, boarding and other expenses incidental to the training.</em></li>\n	<li style="text-align:justify"><em>Rules &ndash; General:- During the term of employment, you will employ yourself efficiently, honestly, faithfully and to the best of your ability and shall devote your whole time and attention to promote the interest of the company and generally carry out duties and work as assigned to you. You shall obey and comply with all the lawful orders and directions given to you by your reporting Manager &amp; concerned superior in the Client organization.</em></li>\n	<li style="text-align:justify"><em>You will not indulge into unprofessional practices and in case, it is found that while you are not following client organization&rsquo;s policies, rules and guidelines, the company would be at liberty to take disciplinary and legal action against you.</em></li>\n	<li style="text-align:justify"><em>Transfer and Deployment:- you may be transferred to any other location in such capacity as the Company may from time to time determine or any department, establishment, factory or branch of the Company or its affiliate, associate or subsidiary. In such cases, you will be governed by the terms and conditions of services applicable to the new assignment.</em></li>\n	<li style="text-align:justify"><em>This engagement is terminable with a fifteen days&rsquo; notice period from both the sides. </em></li>\n	<li style="text-align:justify"><em>In case you are found engaged in doing any work other than the task assigned to you or is found not useful to the project or you leave the project without any notice, your contract will be terminated. If you damage any equipment, property and third party liabilities, your contract will be terminated reserving the rights for compensation of damages that are incurred. </em></li>\n	<li style="text-align:justify"><em>This document is highly confidential, and sharing of this document with anybody such as colleagues, Client etc., will lead to terminate of your employment without notice.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em></li>\n</ol>\n\n<p style="text-align:justify"><strong><em>Declaration:</em></strong><em> </em></p>\n\n<p style="text-align:justify"><em>I &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;........ S/o /D/o /W/o &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;. Sincerely assure you to maintain complete discipline and do my best to perform my duties. I also authorize the management of SBC Exports Ltd to ask me to leave any time without any notice, in case of any misconduct on my part or if I am found violating any rules and regulations laid by the company from time to time or fail to meet the defined performance standards during the training and employment. </em></p>\n\n<p><em>Candidate Name/Signature)&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;..&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Date&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;..</em></p>\n\n<p style="text-align:center"><em>(Save Papers save Trees)</em></p>\n\n<p style="text-align:justify">&nbsp;</p>\n');
